import React from 'react'
import "./Navbar.css";

            //tener acceso a la posicion del scroll
const Navbar = ({isScrolling}) => {
    return (
      <nav className="navbar">
          <div className="navbar-logo">
              Darnell Armas
          </div>
      </nav>
    )
}

export default Navbar
